// Diploma.sol
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract Diploma is ERC721Enumerable, Ownable {

    struct DiplomaData {
        string studentName;
        string degreeType;
        string issuingDate;
    }

    mapping(uint256 => DiplomaData) public diplomaData;

    constructor() ERC721("DiplomaChain", "DC") {}

    function mintDiploma(address to, uint256 tokenId, string memory studentName, string memory degreeType, string memory issuingDate) public onlyOwner {
        _mint(to, tokenId);
        diplomaData[tokenId] = DiplomaData(studentName, degreeType, issuingDate);
    }
}
